import ModalPreviewImport from '@components/shared/modal/ModalPreviewImport'

export default {
  name: 'ModalPreviewImportOrder',
  components: {
    ModalPreviewImport,
  },
  props: {
    visible: {
      type: Boolean,
      default: false,
    },
    importing: {
      type: Boolean,
      default: false,
    },
    total: {
      type: Number,
      default: 0,
    },
    orderErrors: {
      type: Array,
      default: () => [],
    },
    order: {
      type: Object,
      default: () => {},
    },
  },
  methods: {
    handleImportFile() {
      if (this.importing) {
        return
      }
      this.$emit('import')
    },

    handleClose() {
      this.$emit('update:visible', false)
    },
  },
}
